●エフシートは強い粘着力を有し、皮膚を保湿し保護します。<br>
●エフシートは伸縮性に富み、膝、ひじなどの関節可動部にも容易に貼付できます。<br>●エフシートは通常2～3週間くり返し使用することができ経済的です。<hr>

【用途】<br>
傷あと・火傷あとなどに貼付することにより皮膚バリアとして外部からの刺激を和らげる皮膚保護材<hr>

【禁忌・禁止】<br>
表皮の形成されていない開放創および粘膜には使用しないでください。<hr>
【操作方法又は使用方法等】<br><br>
1. サイズの選択：貼付部位に合わせて本品のサイズを選んでください。1枚で足りないときは複数の本品を使用してください。<br><br>
2. 貼付部位の前処置：貼付部位はよく洗って、清潔な布などで水分をよく拭き取ってください。<br><br>
3. 貼付<br><br>
　(1) 容器のふたを開け、付属のヘラを用いて本品を取り出してください。<br>
　(2) 本品接着面（初回開封時の上面）を皮膚面に貼ってください。<br>
　(3) 膝、肘などの関節や、かかとなどの動きやすい部位に貼る場合は、必要に応じて伸縮性包帯やテープなどで軽く押さえてください。<br>
　(4) 本品は、毎日なるべく24時間続けて（入浴時を除く）使用することをお勧めします。<br>
<br>
4. 洗浄、乾燥：本品の接着面に付着した汗やあかの汚れは、必ず毎日1～2回、以下の方法で洗ってください。<br><br>
　(1) 本品を皮膚からはがし、入浴用石けんで軽くこするように洗ってください。石けんは水またはぬるま湯でよくすすいでください。<br>
　(2) 本品を洗った後は、軽く振って水滴を落とし、ちりやほこりの少ない場所で接着面を上にして自然に乾かしてください。濡れていると接着が弱くなるので十分乾かしてください。ヘアドライヤーなどでの加熱乾燥は避けてください。また、紙やタオルの繊維が接着面に付着して取れなくなることがあるので、ティッシュペーパーやタオルなどは用いないでください。<br>
　(3) 本品が乾いたことを確かめてから貼ってください。<br>
<br>
5. 交換：洗っても汚れが落ちなかったり、皮膚への接着が悪くなったら、新しいエフシートに交換してください。<br><br>
6. 入浴時：入浴時には取りはずしてください。<hr>

【使用上の注意】<br><br>
1．重要な基本的注意<br><br>
　(1) 伸縮性包帯やテープなどを用いる場合は、貼付部位を過度に圧迫しないでください。<br>
　(2) 本品の使用中に皮膚の紅斑やそう痒などの異常がみられた場合は、ただちに使用を中止し、医師または薬剤師にご相談ください。<br>
　(3) 小児および監督を必要とする方は、保護者の指導のもとで使用してください。<br>
<br>
2．その他の注意<br><br>
　(1) 本品を口や鼻に入れると窒息の危険があるので、小児および監督を必要とする方の手の届かない所に保管してください。<br>
　(2) 本品は可燃物ですので、火のそばや熱い所には置かないでください。<br>
　(3) 本品の接着面が床などに付着すると滑りやすくなるので、万一付着した場合は、水または石けん水を含んだ布でふきとってください。<br>
　(4) 本品は、高温・多湿および直射日光を避けて保管してください。<br>
　(5) 未使用時は容器に入れ保管してください。<br>
　(6) 排水管などの詰まりの原因になるので、流しなどに流さないでください。<hr>
